public void clicked()
{
    super();

    BankStmtISOReportEntry bankStmtISOReportEntrySelect = formView.getSelectNewStatement();
    BankStmtISOAccountStatement bankStmtISOAccountStatementSelect = BankStmtISOAccountStatement::find(bankStmtISOReportEntrySelect.BankStmtISOAccountStatement);

    if (!FeatureStateProvider::isFeatureEnabled(BankStatementPostPerLineFeature::instance())
        || BankStmtISOReportEntry::updateEmptyAccountingDate(bankStmtISOAccountStatementSelect))
    {
        if (!bankStmtISOAccountStatementSelect.Posted && !TaxUncommitted::existByDocumentLineId(bankStmtISOReportEntrySelect.TableId, bankStmtISOReportEntrySelect.RecId))
        {
            BankStatementTaxDocument bankStatementTaxDocument = BankStatementTaxDocument::construct(bankStmtISOAccountStatementSelect);
            bankStatementTaxDocument.calcTax();
        }

        Args args = new Args();
        args.record(bankStmtISOReportEntrySelect);
        MenuFunction function = new MenuFunction(menuItemDisplayStr(AccountingDistBankStatement), MenuItemType::Display);
        function.run(args);

        formView.performFormRefresh();
    }
}

public void clicked()
{
    super();

    BankStmtISOReportEntry bankStmtISOReportEntrySelect = formView.getSelectNewStatement();
    BankStmtISOAccountStatement bankStmtISOAccountStatementSelect = BankStmtISOAccountStatement::find(bankStmtISOReportEntrySelect.BankStmtISOAccountStatement);

    if (!FeatureStateProvider::isFeatureEnabled(BankStatementPostPerLineFeature::instance())
        || BankStmtISOReportEntry::updateEmptyAccountingDate(bankStmtISOAccountStatementSelect))
    {
        BankStatementTaxDocument bankStatementTaxDocument = BankStatementTaxDocument::construct(bankStmtISOAccountStatementSelect);
        bankStatementTaxDocument.calcTax(TaxUncommitted::existByDocumentLineId(bankStmtISOReportEntrySelect.TableId, bankStmtISOReportEntrySelect.RecId));
        bankStatementTaxDocument.tax().sourceSingleLine(true, true);
        Tax::showTaxes(menuitemDisplayStr(TaxTmpWorkBankStatement), bankStatementTaxDocument.tax(), bankStmtISOReportEntrySelect);

        formView.performFormRefresh();
    }
}

